import React from 'react';
import { NavLink } from 'react-router-dom';
import web from '../src/images/img1.png'
const Common=()=>{
    return(
        <>
        <section id="header" className="d-flex align-items-center ">
            <div className="container-fluid">
                <div className="row">
                    <div className="col-10 mx-auto">
                    <div className="row">
                        <div className="col-md-6 pt-5 pt-lg-0 order-2 order-lg-1 d-flex justify-content-center flex-column">
                            <h1>Welcome to the <strong className="brand-name"><br/>Technical Guru</strong></h1>
                            <h2 className="my-3">We are the team talented Web developer </h2>
                            <div className="mt-3">
                                <NavLink to="/services" className="btn-get-started ">Get started</NavLink>
                            </div>
                        </div>
                        <div className="col-lg-6 order-1 order-lg-2 header-img  d-flex justify-content-center">
                            <img src={web} className="img-fluid animated" alt="home-img"/>
                        </div>
                        </div>
                    </div>
                </div>
            </div>
        </section>
        </>
    );
};
export default Common;
